import React, { useState, useEffect } from 'react';
import axios from 'axios';

export const ContactPage = () => {
    const [location, setLocation] = useState({ lat: null, lng: null });

    const fetchContacts = () => {
        const lat = location.lat;
        const lng = location.lng;

        axios.get(`http://localhost:8081/api/contact?lat=${lat}&lng=${lng}`)
          .then(response => {
          })
          .catch(error => {
            console.error('Error fetching hospitals:', error);
          });
    };

    useEffect(() => {
        const onSuccess = (position) => {
            setLocation({
              lat: position.coords.latitude,
              lng: position.coords.longitude,
            });
        };

        navigator.geolocation.getCurrentPosition(onSuccess);
    }, []);

    useEffect(() => {
        fetchContacts(); // This will log the updated location after it changes
    }, [location]); // Dependency array tells React to run this useEffect when `location` changes


    return (
        <div className='mx-3 mt-3' style={{ paddingBottom: '88px', height: '100vh', width: '100%' }}>
            <h1>404 Page Not Found Contacts</h1>
        </div>
    );
}
